## Quick script to generate hash sums for null strings. Useful when you need it :)
# I am hashing an empty string... also useful :) https://www.virustotal.com/gui/file/e3b0c44298fc1c149afbf4c8996fb92427ae41e4649b934ca495991b7852b855/community

import hashlib

def hashme(input):
    target = input.strip()
    sha1 = hashlib.sha1()
    sha1.update(target.encode())
    
    md5 = hashlib.md5()
    md5.update(target.encode())
    
    sha256  = hashlib.sha256()
    sha256.update(target.encode())
        
    return(md5.hexdigest(), sha1.hexdigest(), sha256.hexdigest())

for i in range(0,1025):
    (md5, sha1, sha256) = hashme("\00" * i)
    print(f'{i} Null Bytes\t{md5}\t{sha1}\t{sha256}')
    

